import background from './background.svg';
import timeline from './timeline.svg';
import './App.css';

function App() {
  return (
    <div>
      <div>
        <header className="App-header">
          <img src={background} />
        </header>
      </div>
      <div>
        <p className="main-text">
            Aakriti & Henry
          </p>
          <img src={background} />
      </div>
    </div>
  );
}

export default App;
